import * as THREE from 'three'
import { useRef, useState } from 'react'
import { Canvas, useFrame, useLoader } from '@react-three/fiber'
import { Bvh, Instances, Instance, Clone, OrbitControls, Environment, useGLTF } from '@react-three/drei'
import { useControls } from 'leva'
import { DRACOLoader } from 'three/examples/jsm/loaders/DRACOLoader.js'

/* import { data } from './store' */

const position = (r) => [1, (Math.random() * 0.5) * r/2, 1]
const data = Array.from({ length: 10 }, (r = 10) => ({ random: Math.random(), position: position(r)}))


export default function App() {
  const { range } = useControls({
    range:
    {
      value: 10,
      min: 1,
      max: 10,
      step: 1
    }
  })
  return (
    <Canvas camera={{ position: [0, 0, 20], fov: 50 }}>
      <ambientLight intensity={0.5 * Math.PI} />
      <directionalLight intensity={0.3} position={[5, 25, 20]} />
      <Bvh firstHitOnly>
        <Model data={data} range={range} />
      </Bvh>
      <primitive object={ panel.scene } scale={ 5 } position-y={ - 1 } />
      <Environment preset="city" />
      <OrbitControls autoRotateSpeed={0}/>
    </Canvas>
  )
}

function Models({ data, range, props}) {
  const { nodes, materials } = useGLTF('/panelEdited.glb')

  return (
    <Clone range={range} {...props}>
      {data.map((props, i) => (
        <Model key={i} {...props} />
      ))}
    </Clone>
  )
}

const panel = () => {
  const model = useLoader(
    GLTFLoader,
    '/panelEdited.glb',
    (loader) =>
    {
        const dracoLoader = new DRACOLoader()
        dracoLoader.setDecoderPath('./draco/')
        loader.setDRACOLoader(dracoLoader)
    }
  )
}

